import React, { useState } from "react";
import { useAuth } from "../AuthProvider";
import Navbar from "../components/NavBar";
import '../styles/Registers.css';

const Register = () => {
    const [data, setData] = useState({
        email: "",
        name: "",
        lastName: "",
        phone: "",
        address: "",
        password: ""
    });
    const [mensaje, setMensaje] = useState("");
    const auth = useAuth();

    const handleSubmitEvent = async (e) => {
        e.preventDefault();

        try {
            const response = await fetch("http://localhost:3000/cliente", {
                method: "POST",
                headers: {
                    "Content-Type": "application/json",
                    Authorization: `Bearer ${auth.token}`,
                },
                body: JSON.stringify(cliente),
            });
            const data = await response.json();
            if (response.ok) {
                setMensaje(data.message);
                setData({
                    email: "",
                    name: "",
                    lastName: "",
                    phone: "",
                    address: "",
                    password: ""
                });
            } else {
                setMensaje(data.message || "Error al registrar el Cliente");
            }
        } catch (error) {
            console.error("Error al registrar el Cliente:", error.message);
            setMensaje("Error de conexión");
        }
    };

    const handleInput = (e) => {
        const { name, value } = e.target;
        setData((prev) => ({
            ...prev,
            [name]: value,
        }));
    };

    return (
        <div>
            <Navbar />
            <div className="backgroundRCli">
                <div className="containerRCli">
                    <div id="mensaje">{mensaje}</div>
                    <h2 className="tituloU-C">Registrarse</h2>
                    <form id="datos" onSubmit={handleSubmitEvent}>
                        <div className="form_controlRU">
                            <label htmlFor="email">Correo electrónico:</label>
                            <input
                                className="inputU"
                                type="email"
                                id="email"
                                name="email"
                                value={data.email}
                                onChange={handleInput}
                            />
                        </div>
                        <div className="two-column-container">
                            <div className="form_controlRU">
                                <label htmlFor="name">Nombre:</label>
                                <input
                                    className="inputU"
                                    type="text"
                                    id="name"
                                    name="name"
                                    value={data.name}
                                    onChange={handleInput}
                                />
                            </div>
                            <div className="form_controlRU">
                                <label htmlFor="lastName">Apellidos:</label>
                                <input
                                    className="inputU"
                                    type="text"
                                    id="lastName"
                                    name="lastName"
                                    value={data.lastName}
                                    onChange={handleInput}
                                />
                            </div>
                        </div>
                        <div className="form_controlRU">
                            <label htmlFor="phone">Número de celular:</label>
                            <input
                                className="inputU"
                                type="number"
                                id="phone"
                                name="phone"
                                value={data.phone}
                                onChange={handleInput}
                            />
                        </div>
                        <div className="form_controlRU">
                            <label htmlFor="address">Dirección:</label>
                            <input
                                className="inputU"
                                type="text"
                                id="direccion"
                                name="direccion"
                                value={data.lastName}
                                onChange={handleInput}
                            />
                        </div>
                        <div className="form_controlRU">
                            <label htmlFor="password">Contraseña:</label>
                            <input
                                className="inputUCli"
                                type="password"
                                id="password"
                                name="password"
                                value={data.password}
                                onChange={handleInput}
                            />
                        </div>
                        <button className="btn-submitRM">Registrar</button>
                    </form>
                </div>
            </div>
        </div>
    );
};

export default Register;
